import './App.css';
import { UnderC } from './components/UnderC';

React.useEffect(() => {
  const script = document.createElement('script');
  script.src = 'https://apply.devfolio.co/v2/sdk.js';
  script.async = true;
  script.defer = true;
  document.body.appendChild(script);
  return () => {
    document.body.removeChild(script);
  }
}, []);

function App() {
  return (
    <UnderC/>
  );
}

export default App;
